import React, {Component} from 'react';
import Nav from 'react-bootstrap/Nav';
import NavStock from './NavStock';

class FutureGrowth extends Component {
    render(){
        return(
        <div>
            <NavStock/>
            <div>Key Metric</div>
            <div id ="metric">
                <div> Moat </div>
                <div> No.of Fund owning </div>
                <div> Sharpe Ratio </div> 
                <div> Market Cap </div>
                <div> Sector </div> 
            </div>
            <div id ="metric">
                <div> Price/Sales </div>
                <div> Price/Earnings </div>
                <div> Forward P/E </div> 
                <div> Price/Bookp </div>
                <div> PEG Ratio </div> 
            </div>
            <div id ="metric">
                <div> Rev 3-Yr Growth </div>
                <div> ROE % </div>
                <div> Operating Margin </div> 
                <div> Div Yield </div>
                <div> Current Ratio </div> 
            </div>
        </div>
        );
    }
}
export default FutureGrowth;
